import styles from './Abaut.module.css';
import git0 from './Pictures/git0.png';
import git1 from './Pictures/git1.jpg';
const Abaut =(props)=>(
    <div  className={styles.Abaut}>
        <img className={styles.Img}src={git1}/>
    </div>
);

export default Abaut;
